import React from 'react';
import {Link} from 'react-router-dom'
import './sidebar.css'

const Sidebar = () => {
  return (
    <div className="sidebar">
      <Link to="/dashboard"><div className="sidebar-item">Dashboard</div></Link>
      <div className="sidebar-item">API Keys</div>
      <div className="sidebar-item">SDKs</div>
      <div className="sidebar-item">Deployments</div>
      <div className="sidebar-item">Wizard</div>
    </div>
  );
};

export default Sidebar;
